import React from 'react';
import './styleJobOpening.css';

function jobOpening(props) {
  return (
    <>
      <div className="jopOpenings-header">
        <h3>Job openings</h3>
      </div>

      <div className="jopOpenings-title">
          <p>
          Welcome! We want people to thrive. We believe you do your best work when you feel your best.
          </p>
      </div>
    </>
  );
}

export default jobOpening;
